import { eventBus } from "../main.js";
import AppImage from "./Image.vue";
import AppAnalysis from "./Analysis.vue";
export default {
  components: {
    AppImage: AppImage,
    AppAnalysis: AppAnalysis
  },
  data: function data() {
    return {
      componentKey: 0,
      // Just as with the main app, the 'reset image' button the bottom bar resets this specific component.
      visionComponent: AppImage // Starts with AppImage by default, waiting for the eventBus to fire to tell it to switch to Analysis.
    };
  },
  created: function created() {
    var _this = this;
    eventBus.$on('toAnalysis', function () {
      _this.visionComponent = 'AppAnalysis'; // Switches to Analysis component.
    });
  }
};
